const OFF = "off";

module.exports = {
  root: true,
  extends: "eslint:recommended",
  parserOptions: {
    ecmaVersion: 2017,
    sourceType: "module"
  },
  env: {
    jest: true,
    es6: true,
    node: true
  },
  plugins: ["prettier"],
  rules: {
    "linebreak-style": ["error", "unix"],
    "no-cond-assign": OFF,
    "no-case-declarations": OFF,
    "prettier/prettier": ["error", { printWidth: 80 }]
  }
};

/**
 * Reason for Filename to be babel.config.js
 *
 * https://github.com/babel/babel/pull/7784
 * https://github.com/facebook/jest/issues/6053#issuecomment-383632515
 */

module.exports = {
  presets: [
    [
      "@babel/preset-env",
      {
        targets: {
          node: 6
        }
      }
    ]
  ]
};

"use strict";

const through = require("through2");
const chalk = require("chalk");
const newer = require("gulp-newer");
const babel = require("gulp-babel");
const log = require("fancy-log");
const gulp = require("gulp");
const path = require("path");

const build = gulp.series(buildPackages, buildUtils);

const watch = gulp.series(build, () => {
  const scripts = [
    getBuildConfig("packages").scripts,
    getBuildConfig("utils").scripts
  ];
  gulp.watch(scripts, { debounceDelay: 200 }, build).on("error", () => {});
});

function buildPackages() {
  return getBuildTask(getBuildConfig("packages"));
}

function buildUtils() {
  return getBuildTask(getBuildConfig("utils"));
}

exports.build = build;
exports.watch = watch;
exports.buildPackages = buildPackages;
exports.buildUtils = buildUtils;

function getBuildTask({ scripts, dest }) {
  return gulp
    .src(scripts)
    .pipe(
      through.obj((file, enc, callback) => {
        file._path = file.path;
        file.path = path.resolve(file.base, swapSrcWithLib(file.relative));
        callback(null, file);
      })
    )
    .pipe(newer(dest))
    .pipe(
      through.obj((file, enc, callback) => {
        log("Compiling", "'" + chalk.cyan(file._path) + "'...");
        callback(null, file);
      })
    )
    .pipe(babel())
    .pipe(gulp.dest(dest));
}

function getBuildConfig(dir) {
  const scripts = `./${dir}/*/src/**/*.js`;
  const dest = dir;

  return { scripts, dest };
}

function swapSrcWithLib(srcPath) {
  const parts = srcPath.split(path.sep);
  parts[1] = "lib";
  return parts.join(path.sep);
}

